def fetch_classes(tid, timeout=3):
    r = requests.get("https://www.ratemyprofessors.com/paginate/professors/ratings?tid={}".format(tid))

    classes = []
    if r.status_code == 200:
        j = json.loads(r.text)
        for rating in j["ratings"]:
            classes.append(rating["rClass"])
        return classes
    else:
        raise Exception("something broke {} : {}".format(r.status_code, r.text))


all_classes = []
with concurrent.futures.ThreadPoolExecutor(max_workers=24) as executor:
    futures = []
    for tid in array:
        futures.append(
            executor.submit(fetch_classes, tid=tid)
        )        
    for i, future in enumerate(concurrent.futures.as_completed(futures)):
        print("{}/{}".format(i+1, len(futures)))
        try:
            all_classes.extend(future.result())
        except Exception as err:
            print(err)

with open("courseSample.json", "w") as f:
    f.write(json.dumps(sorted(all_classes)))
    
